import React from 'react';

class OrdersList extends React.Component {
  render() {
    return (
      <ul className="list-unstyled">
        {this.state.data.map((order) => {
          return (
            <li key={order.orderId}>
              <p>{order.orderName}</p>
            </li>
          );
      })}
      </ul>
    )
  }
}

export default OrdersList;
